// import React, { useEffect } from 'react';
// import $ from 'jquery';
// import 'owl.carousel/dist/owl.carousel';
// import 'owl.carousel/dist/assets/owl.carousel.min.css';
// import 'bootstrap/dist/css/bootstrap.min.css';
// import '../css/owl.carousel.min.css'; // Make sure to adjust the path according to your project structure

import React, { useEffect } from 'react';
// import $ from 'jquery';
// import 'owl.carousel/dist/owl.carousel';
// import 'owl.carousel/dist/assets/owl.carousel.min.css'
import '../css/style.css'; // Similarly, adjust the path
import 'bootstrap/dist/css/bootstrap.min.css';    
import Dron from "../image/dron.jpeg"
import Camera from "../image/camera.jpg"
import Headphones from "../image/headphones.jpg"


const Carousel = () => {
  useEffect(() => {
    // Initialize Owl Carousel
    ('.your-carousel-selector').owlCarousel({
      // Owl Carousel options
    });
  }, []);

  return (
    <div>
      <section className="ftco-section">
        <div className="container">
      <div className="row">
        <div className="col-md-12 text-center">
            <h2 className="heading-section mb-5 pb-md-4">Our Products!!</h2>
         </div>
          <div className="col-md-12">
            <div className="slider-hero">
              <div >
                <div className="item">
                  <div className="work">
                   <div
                      className="img d-flex align-items-center justify-content-center"
                    >
                       <img
          src={Dron}
          alt="dron"
          draggable="false"
        />
                      <div className="text text-center">
                        <h2>Discover New Places</h2>
                      </div>
                    </div>
                  </div>
                </div>
                <div className="item">
                  <div className="work">
                    <div
                      className="img d-flex align-items-center justify-content-center"

                    >
                       <img
          src={Camera}
          alt="camera"
          draggable="false"
        />
                      <div className="text text-center">
                        <h2>Dream Destination</h2>
                      </div>
                    </div>
                  </div>
                </div>
                <div className="item">
                  <div className="work">
                    <div
                      className="img d-flex align-items-center justify-content-center"

                    >
                       <img
          src={Headphones}
          alt="headphones"
          draggable="false"
        />
                      <div className="text text-center">
                        <h2>Travel Exploration</h2>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
              <div className="my-5 text-center">
                <ul className="thumbnail">
                  <li className="active img">
                    <a href="#">
                      <img
                        src={Dron}
                        alt="dron"
                        draggable="false"
                        className="img-fluid"
                      />
                    </a>
                  </li>
                  <li>
                    <a href="#">
                      <img
                          src={Camera}
                          alt="camera"
                          draggable="false"
                        className="img-fluid"
                      />
                    </a>
                  </li>
                  <li>
                    <a href="#">
                      <img
                          src={Headphones}
                          alt="headphones"
                          draggable="false"
                        className="img-fluid"
                      />
                    </a>
                  </li>
                </ul>
              </div>
            </div>
          </div>
        </div>
      </div>
      </section> 
    </div>
  );
};


export default Carousel;



